import React, { useState } from "react";

import AdminPage from './components/Admin/AdminPage'
import Login from "./components/Login/Login"

const App = () => {
  return (
    <div>
      <Routes>
        <Route path="/AdminPage" element={<AdminPage />}>
        </Route>
      </Routes>
      <Login />
    </div>
  );
};

export default App;
